import React, {Component} from 'react';
import './Users.css';

class Users extends Component {

    render() {
        return(
            <div className='users-main'>
                <h1>User's List</h1>
                <form action=''>
                    <input type='text' placeholder='Enter name'/>
                    <button type='submit'>Add user</button>
                </form>
                <ul>
                    <li>Halina</li>
                    <li>Helena</li>
                </ul>
            </div>
        )
    }
}

export default Users;
